import React from 'react';
import Flight from '../../Parts/Header/Search/flight/flight.js'
import Car from '../../Parts/Header/Search/car/car.js'
import Hotel from '../../Parts/Header/Search/hotel/hotel.js'
class TabNavContent extends React.Component{
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="tab-content">
        {this.props.tabscontent}
      </div>
    );
  }
}
export default TabNavContent
